import Head from 'next/head';

export const config = { amp: true };

function TalksPage() {
  return (
    <Layout>
        <Head>
        <title>Naina Raisinghani</title>
        <link rel="icon" href="data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 100 100%22><text y=%22.9em%22 font-size=%2290%22>ðŸ’©</text></svg>" />
        <script async key="amp-youtube" custom-element="amp-youtube" src="https://cdn.ampproject.org/v0/amp-youtube-0.1.js"
            />
        </Head>
      <main>
        <div className="container">
          <div className="title">
              <h2>Google - Mountain View, CA, USA</h2>
              <h3>Product Manager - AMP</h3>
              <h4>January 2019 - Present</h4>
          </div>
          <div className="text">
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Nulla facilisi morbi tempus iaculis urna id volutpat lacus laoreet. Sed pulvinar proin gravida hendrerit lectus. Nisl suscipit adipiscing bibendum est ultricies. Elit ut aliquam purus sit amet luctus venenatis lectus. Consequat interdum varius sit amet mattis vulputate enim nulla. Enim nunc faucibus a pellentesque sit amet porttitor eget dolor. Faucibus ornare suspendisse sed nisi lacus sed viverra tellus. Nec ultrices dui sapien eget mi proin sed. Consequat semper viverra nam libero justo laoreet sit amet. Laoreet id donec ultrices tincidunt. Mauris pharetra et ultrices neque ornare aenean. Et tortor at risus viverra. Tempor nec feugiat nisl pretium fusce id velit. Tellus rutrum tellus pellentesque eu tincidunt. Purus sit amet volutpat consequat mauris nunc congue nisi. Est lorem ipsum dolor sit amet consectetur.
            </p>
          </div>

          <div className="title">
            <h2>Google - Mountain View, CA, USA</h2>
            <h3>Software Engineer - AMP</h3>
            <h4>February 2018 - December 2018</h4>
          </div>
          <div className="text">
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Nulla facilisi morbi tempus iaculis urna id volutpat lacus laoreet. Sed pulvinar proin gravida hendrerit lectus. Nisl suscipit adipiscing bibendum est ultricies. Elit ut aliquam purus sit amet luctus venenatis lectus. Consequat interdum varius sit amet mattis vulputate enim nulla. Enim nunc faucibus a pellentesque sit amet porttitor eget dolor. Faucibus ornare suspendisse sed nisi lacus sed viverra tellus. Nec ultrices dui sapien eget mi proin sed. Consequat semper viverra nam libero justo laoreet sit amet. Laoreet id donec ultrices tincidunt. Mauris pharetra et ultrices neque ornare aenean. Et tortor at risus viverra. Tempor nec feugiat nisl pretium fusce id velit. Tellus rutrum tellus pellentesque eu tincidunt. Purus sit amet volutpat consequat mauris nunc congue nisi. Est lorem ipsum dolor sit amet consectetur.
            </p>
