      color: #d8156e;
    }
    .container {
        display: grid;
        grid-template-columns: 480px 480px;
        grid-template-rows: 270px;
        grid-gap: 10px;
    }
    .title {
        text-align: center;
        vertical-align: middles;
    }
    main {
        position: fixed;
        margin: 0;
        top: calc(50%);
        left: 50%;
        transform: translate(-50%, -50%);
    }

    @media only screen and (max-width: 768px) {
        .container {
            display: block;
        }    
        main {
            position:relative;
            z-index:-1;
            left: 0;
            transform: translate(0%, 0%);
            top:3.75em;
        }  
    }


  `}</style>
    </Layout>
  );
}

export default TalksPage;
